window.bookSummaryJSON = "<p>Hell hath no fury like a woman scorned...especially a dead one holding a grudge. </p> <p>Back on Deadwood's list of usual suspects, Violet Parker is hip deep in wild frights and fired-up females. After juggling bitter threats, haunted buildings, and vengeful ghosts, the last thing she needs is a pair of bullheaded detectives trying to pin another murder on her tail. </p> <p>Can Violet find the real killer before she ends up behind bars? Or worse, on a slab at the morgue. </p>"; 
